import { useEffect } from "react";

import userService from "./Appservices/App.service";

function App() {
  useEffect(() => {
    async function fetchResults() {
      try {
        const response = await userService.getAll("stages");

        if (response.data) {
          console.log(response.data.items);
        }
      } catch (e) {
        console.log(e);
      }
    }
    fetchResults();
  }, []);


  return null;
}

export default App;
